                <div className="info">
                    <h2 className="info-content">Phone: (787) 668-8096</h2>
                        <div class="bullet"></div>
                    <h2 className="info-content">Email: c.carrasquillo@ufl.edu</h2>
                        <div class="bullet"></div>
                    <h2 className="info-content">Domain: http://www.CarlosCarras.com</h2>
                </div>
            </div>
            hello
        </div>
    );
}

export default ResumeContent;
